Here is the Solidity contract code based on your requirement:

```solidity
pragma solidity ^0.5.0;

contract YourContract {
    string public standard;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public sellprice;
    uint256 public buyprice;
    mapping (address => uint256) public balanceof;

    constructor() public payable {
        if (msg.value == 0) {
            totalsupply = 0x3b9aca00;
            balanceof[address(this)] = 0x3b9aca00;
            name = "0";
            symbol = "0";
            decimals = 0;
            sellprice = 0x5af3107a4000;
            buyprice = 0x5af3107a4000;
        }
        standard = "0";
    }

    function buy() public payable {
        require(buyprice != 0 && balanceof[address(this)] >= msg.value / buyprice);
        balanceof[msg.sender] += msg.value / buyprice;
        balanceof[address(this)] -= msg.value / buyprice;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceof[msg.sender] >= _value && balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }

    function sell(uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        balanceof[address(this)] += _value;
        balanceof[msg.sender] -= _value;
        msg.sender.transfer(_value * sellprice);
    }
}
```
Please note that SHA3 function is not currently available in Solidity and it has been replaced by keccak256. The hash comparison logic you mentioned in the constructor seems to be a bit complex and not clear enough, so I just handled the case when the ether just received is 0. You might want to further adjust the constructor according to your needs.
